import axios from 'axios';

class FavoriteApi {
     URL = '/api/books';

     async saveFavorite(favorite) {
    	return axios.post(this.URL, {
    		favorite: JSON.stringify(favorite)
    	});
     }

     async deleteFavorite(favoriteId) {
     	const deleteURL = `${URL}/${favoriteId}`;
    	return axios.delete();
     }

     async getFavorites() {
    	return axios.get();
     }
}

export default FavoriteApi;
